    [],nt"num_tags": 0,nt"name": "mosaic-of-gridded-multibeam-bathymetry-lidar-bathymetry-and-bathymetry-derived-from-multispectr",nt"isopen":
    false,nt"url": null,nt"notes": "Gridded multibeam bathymetry is integrated
    with gridded LiDAR bathymetry and bathymetry derived from multispectral IKONOS satellite
    data. Gridded (5 m cell size) multibeam bathymetry collected aboard NOAA Ship Hiialaka'i
    and R/V AHI. Lidar bathymetry were collected by the Naval Oceanographic Office.
    Bathymetry values shallower than 25 m were derived by gauging the reletive attenuation
    of blue and green spectral radiance as a function of depth. A multiple linear regression
    analysis of linearized blue and green band spectral values against depth determined
    the variables of y-intercept, blue slope and green slope values. Variables then
    used in multivariate slope intercept formula to derive depth. Variables were adjusted
    to improve the statistical accuracy and spatial coverage of the final derived bathymetry
    product. Digital image processing to derive depths conducted with the ENVI 4.5 software
    program while data editing and integration was performed using ArcGIS 9.3. This
    dataset is for the shelf environment of Saipan Island, Commonwealth of Northern
    Mariana Islands, USA",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
